import React, { Component } from "react";
import Login from "./components/login";
import './App.css';

class App extends Component {

  handleClick() {
    console.log("Button clicked");
  }

  render() {
    console.log("Test4")
    return (
      <div style="border: 1px solid" input type="button" value="button" style="display: block; margin: 0 auto;">
        <main className="buttons">
          <Login
            test={this.handleClick}
          />
          {/* <header className="App-header">
            Login Page
        </header> */}
        </main>
      </div>
    );
  }
}

export default App;
